import Icon, { LeftOutlined } from "@ant-design/icons";
import { Button, Space, Typography } from "antd";
import { useContext } from "react";
import { ReactComponent as IconLogo } from "../../../images/stripe-brands.svg";
import { BookingStatusContext } from "../../../utils/BookingState";
import { StyledButtonNavDiv, StyledContentDiv } from "../../Styles/Div.style";
import { StyledPrompt } from "../../Styles/Title.style";
import PaymentButton from "./PaymentButton";

const Payment = () => {
  const { currentStep, setCurrentStep } = useContext(BookingStatusContext);

  return (
    <>
      <Typography>
        <StyledPrompt level={5}>
          Please enter your payment details{" "}
        </StyledPrompt>
        <Icon component={IconLogo} />
      </Typography>
      <StyledContentDiv>
        <PaymentButton />
      </StyledContentDiv>
      <br />
      <br />
      <StyledButtonNavDiv>
        <Space>
          <Button
            type="primary"
            shape="circle"
            size="large"
            icon={<LeftOutlined />}
            onClick={() => setCurrentStep(currentStep - 1)}
          />
        </Space>
      </StyledButtonNavDiv>
    </>
  );
};

export default Payment;
